import './App.css';
import React from "react";
import Header from "./Header";
import AddContact from "./AddContact";
import ContactList from "./ContactList";
function App() {

  const contacts = [{

    id:"1",
    name : "preethi",
    email:"xyz@gmail.com"

  },{
    id:"2",
    name : "saitu",
    email:"abc@gmail.com"
  }]
  return (
    <div className="ui container">
      <Header />
      <AddContact />
      <ContactList />
    </div>
  );
}

export default App;
